import React from "react";
import "./Post.css";
import logo from "../images/instagramwhite_logo.png";
const Post=()=>{
return(
    <>
    <div className="post">
        <div className="post_header">
            <div className="post_logo">
                <img src="https://unsplash.com/photos/jHWNlS_0VV0" alt="post_image"/>
            </div>
            <div className="post_title">
                <p>Sudha Gurung</p>
            </div>
            <div className="post_button"></div>
        </div>
        <div className="post_body">
            <div className="post_image">
            <img src={logo} alt="post_image" />
            </div>
            <div className="post_description">

            </div>
        </div>
        <div className="post_comment"></div>
    </div>
    </>
);
}

export default Post;
